/**********************/
/* METRIC - Time Zero */
/**********************/

/* Time Zero for All Sepsis Patients */

/* Time zero is defined here as either of these two events:
   * ED triage
   * Suspected infection and 2 SIRS criteria, whichever happened last
 */

/* Grain: Primary patient encounter */

/* Time Zero for ED patients with Sepsis POA */
WITH EDPatient AS (
SELECT
    pop.FacilityAccountID
   ,pop.PatientEncounterID
   ,'ED Triage' AS TimeZeroDSC
   ,ed.EdTriageStartDTS AS TimeZeroDTS
FROM SAM.Sepsis.PopulationEncounter AS pop
INNER JOIN SAM.Sepsis.MetricEDEvent AS ed
   ON pop.PatientEncounterID = ed.PatientEncounterID
WHERE pop.EDPatientFLG = 'Y'
  AND pop.SepsisPresentOnAdmitFLG = 'Y'
)

/* Time Zero for Septic Patients Who Did Not Come Through the ED with Sepsis POA */
,Inpatient AS (
SELECT
    pop.FacilityAccountID
   ,pop.PatientEncounterID
   ,'Suspected Infection and 2 SIRS' AS TimeZeroDSC
   ,pop.SuspectedInfectionAnd2SIRSDTS AS TimeZeroDTS
FROM SAM.Sepsis.PopulationEncounter AS pop
WHERE pop.PatientEncounterID NOT IN (SELECT PatientEncounterID FROM EDPatient) /* All non-ED-sepsis-POA patients (some possibly not yet diagnostic-coded) */
)

/* Sepsis-ED-POA Patients and Sepsis Inpatients Combined */
SELECT * FROM EDPatient

UNION ALL

SELECT * FROM Inpatient
;
